define('powa/utils/timeurls',["jquery", "foundation-daterangepicker"], function($){
    var DateRangePicker = Backbone.View.extend({

        events: {
            'change [data-role="start_date"]': "inputChange",
            'change [data-role="end_date"]': "inputChange"
        },

        initialize: function(args){
            var now = this.now = moment(),
                self = this,
                params = DateRangePicker.parseUrl(window.location.search);
            this.format = "YYYY-MM-DD HH:mm:ss";
            this.$el = args.$el;
            this.$el.daterangepicker({
                timePicker: true,
                timePicker12Hour: false,
                timePickerIncrement: 1,
                opens: "left",
                ranges: {
                    'hour': [now.clone().subtract('hour', 1), now],
                    'day': [now.clone().subtract('day', 1), now],
                    'week': [now.clone().subtract('week', 1), now],
                    'month': [now.clone().subtract('month', 1), now],
                }
            }, function(start_date, end_date){
                self.pickerChanged(start_date, end_date);
            });
            this.daterangepicker = this.$el.data('daterangepicker');
            this.daterangepicker.hide();
            this.daterangepicker.container.removeClass('hide');
            this.daterangepicker.startDate = params["from"] ? moment(params["from"]) : now.clone().subtract("hour", 1);
            this.daterangepicker.endDate = params["to"] ? moment(params["to"]) : now;
            this.start_date = this.daterangepicker.startDate;
            this.end_date = this.daterangepicker.endDate;
            this.startInput = this.$el.find('[data-role="start_date"]');
            this.endInput = this.$el.find('[data-role="end_date"]');
            this.daterangepicker.notify();
            this.daterangepicker.updateCalendars();
        },
        updateUrls : function(start_date, end_date){
                var params = DateRangePicker.parseUrl(window.location.search),
                    self = this,
                    defaultrange = this.daterangepicker.ranges['hour'];
                this.startInput.val(start_date.format(this.format));
                this.endInput.val(end_date.format(this.format));
                // If the range is the default range, ignore
                if(start_date.isSame(defaultrange[0]) && end_date.isSame(defaultrange[1])){
                    return;
                }
                if(!(params["from"] == start_date.format() &&
                   params["to"] == end_date.format())){
                    params["from"] = start_date.format();
                    params["to"] = end_date.format();
                    history.pushState({}, "", window.location.pathname + "?" + $.param(params, true));
                }

                $('[data-url-has-params]').each(function(){
                        var params = DateRangePicker.parseUrl(this.search);
                        params["from"] = start_date.format();
                        params["to"] = end_date.format();
                        self.startInput.val(start_date.format(self.format));
                        self.endInput.val(end_date.format(self.format));
                        this.search = $.param(params, true);
                });
        },

        inputChange: function(){
            var start_date =  moment(this.startInput.val()),
                end_date = moment(this.endInput.val());
            this.daterangepicker.hide();
            if(start_date.isValid() && end_date.isValid()){
                this.start_date = this.daterangepicker.startDate = start_date;
                this.end_date = this.daterangepicker.endDate = end_date;
                this.daterangepicker.updateView();
                this.daterangepicker.updateCalendars();
                this.pickerChanged(start_date, end_date);
            }
        },

        pickerChanged: function(start_date, end_date){
            this.start_date = this.daterangepicker.startDate;
            this.end_date = this.daterangepicker.endDate;
            if(moment.isMoment(this.start_date) && moment.isMoment(this.end_date)
                    && this.start_date.isValid() && this.end_date.isValid()){
                this.updateUrls(start_date, end_date);
                this.trigger("pickerChanged", start_date, end_date);
            }
        }}, {
        parseUrl : function(search){
                var params = {},
                pairs = search.replace(/^\?/,'').split('&');
                $.each(pairs, function(){
                    var kv = this.split("="),
                    key = kv[0],
                    value = kv[1];
                    if(key.length == 0){
                        return;
                    }
                    value = value.replace("+", " ");
                    value = decodeURIComponent(value);
                    if(params[key]){
                        if(!$.isArray(params[key])){
                            params[key] = [params[key]];
                        }
                        params[key].push(value);
                    } else {
                        params[key] = value;
                    }
                });
                return params;
        }

        });
    return DateRangePicker;
});

define('powa/views/DashboardView',[
    'jquery',
    'foundation/foundation.equalizer',
    'backbone',
    'powa/views/WidgetView',
    'foundation-daterangepicker',
    'moment',
    'powa/utils/timeurls'
], function(jquery, foundation, Backbone, WidgetView, daterangepicker,
    moment, timeurls){
    return WidgetView.extend({
        tagName: "div",
        typname: "dashboard",

        initialize: function(args){
            var self = this;
            this.dashboard = args.model;
            this.data_sources = args.data_sources;
            this.views = [];
            this.render();
        },

        render: function(){
            var wc = this.$el;
            wc.html("");
            var widgets = this.dashboard.get("widgets");
            var maxy = widgets.max(function(wg){
                return wg.get("y");
            });
            this.views = [];
            for(var y = 0; y <= maxy.get("y"); y++){
                var newrow = $('<div>').addClass("row"),
                    rowwidgets = widgets.where({y: y});
                if(rowwidgets.length > 1){
                    newrow.attr("data-equalizer", "");
                }
                wc.append(newrow);
                var    len = 12 / rowwidgets.length;
                _.each(rowwidgets, function(widget) {
                    var panel = $('<div>').addClass('widget columns large-' + len),
                        widgetcontainer = $('<div>').addClass('widget panel').attr("data-equalizer-watch", ""),
                        view;
                    newrow.append(panel);
                    panel.append(widgetcontainer);
                    widget.set({
                        from_date: this.from_date,
                        to_date: this.to_date
                    });
                    try{
                        view = this.makeView(widget);
                        view.from_date = this.from_date;
                        view.to_date = this.to_date;
                        this.listenTo(view, "widget:update", this.postRender, this);
                        this.listenTo(view, "widget:zoomin", this.zoomIn, this);
                        this.listenTo(view, "widget:updateperiod", this.updatePeriod, this);
                        widgetcontainer.append(view.render().el);
                        this.views.push(view);
                    } catch(e) {
                        console.error("Could not instantiate widget " + widget.get("title"), e);
                        return;
                    }
                }, this);
            }
            return this;
        },

        show: function(){
            _.each(this.views, function(view){
                view.show();
            });
        },

        postRender: function(){
            this.$el.foundation();
        },

        makeView: function(widget){
            return WidgetView.makeView(widget);
        },

        addWidget: function(graph){
            this.layout();
        },

        refreshSources: function(startDate, endDate){
            this.dashboard.data_sources.each(function(data_source){
                if(data_source.get("enabled") != false){
                    data_source.update(startDate, endDate);
                }
            });
            this.updatePeriod(startDate, endDate);
        },

        zoomIn: function(startDate, endDate){
            _.each(this.views, function(widget){
                widget.zoomIn(startDate, endDate);
            }, this);
            this.refreshSources(startDate, endDate);
            this.trigger("dashboard:updatePeriod", startDate, endDate);
        },

        updatePeriod: function(startDate, endDate){
            var self = this;
            if(startDate.isValid()){
                this.from_date = startDate;
            }
            if(endDate.isValid()){
                this.to_date = endDate;
            }
            _.each(this.views, function(widget){
                widget.updatePeriod(this.from_date, this.to_date);
            }, this);
        },

    });
});

define('powa/models/Widget',['backbone'], function(Backbone){
    var registry = {};
    return Backbone.Model.extend({
        initialize: function(){
            this.listenTo(this.get("contentsource"), "contentsource:dataload", this.update);
            this.listenTo(this.get("contentsource"), "contentsource:dataload-failed", function(message){
              this.trigger("widget:dataload-failed", message);
            });
        },
        update: function(content){
            this.trigger("widget:needrefresh", content);
        }
    }, {
        extend: function(instanceattrs, clsattrs){
            var newcls = Backbone.Model.extend.apply(this, [instanceattrs, clsattrs]);
            registry[newcls.prototype.typname] = newcls;
            return newcls;
        },
        fromJSON: function(jsonobj){
            var cls = registry[jsonobj.type];
            if(cls == undefined){
                throw "Unknown widget type: " + jsonobj.type;
            }
            return cls.fromJSON(jsonobj);
        }
    });
});

define('powa/models/DataSource',['backbone'], function(Backbone, Metric, MetricCollection){
    return Backbone.Model.extend({
        initialize: function(){
        },

        getUrl: function(from_date, to_date){
            var url = this.get("data_url"),
                params = {from: from_date.format("YYYY-MM-DD HH:mm:ssZZ"),
                          to: to_date.format("YYYY-MM-DD HH:mm:ssZZ")};
            return url + "?" + jQuery.param(params);
        }

    }, {
        fromJSON: function(jsonobj){
            return new this(jsonobj);
        }
    });
});

define('powa/models/DataSourceCollection',['backbone', 'powa/models/DataSource'], function(Backbone, DataSource){
    return Backbone.Collection.extend({
        model: DataSource,

        update: function(from_date, to_date){
            this.each(function(datasource){
                datasource.update(from_date, to_date);
            });
        }

    }, {
        get_instance: function(){
            if(this._instance === undefined){
                this._instance = new this();
            }
            return this._instance;
        }
    });
});

define('powa/models/Content',['backbone',
        'powa/models/Widget',
        'powa/models/DataSourceCollection'],
function(Backbone, Widget, DataSourceCollection){
    return Widget.extend({
        typname: "content",
        initialize: function(){
            this.listenTo(this.get("contentsource"), "contentsource:dataload", this.update);
            this.listenTo(this.get("contentsource"), "contentsource:dataload-failed", function(message){
              this.trigger("widget:dataload-failed", message);
            });
        },
        update: function(content){
            this.trigger("widget:needrefresh", content);
        }

    }, {
        fromJSON: function(jsonobj){
            var group = DataSourceCollection.get_instance();
            jsonobj.contentsource = group.findWhere({name: jsonobj.content});
            if(jsonobj.contentsource === undefined){
                throw ("The content source could not be found.");
            }
            return new this(jsonobj);
        }
    });
});

