define('powa/rickshaw/Rickshaw.Graph.DragZoom',[
    'rickshaw'
], function(Rickshaw){

Rickshaw.namespace('Rickshaw.Graph.DragZoom');

Rickshaw.Graph.DragZoom = Rickshaw.Class.create({

  initialize: function(args) {
    if (!args.graph) {
      throw "Rickshaw.Graph.DragZoom needs a reference to a graph";
    }
    var defaults = {
      opacity: 0.5,
      fill: 'steelblue',
      minimumTimeSelection: 0.02,
      callback: function() {}
    };

    this.graph = args.graph;
    this.svg = d3.select(this.graph.element).select("svg");
    this.svgWidth = parseInt(this.svg.attr("width"), 10);
    this.opacity = args.opacity || defaults.opacity;
    this.fill = args.fill || defaults.fill;
    this.minimumTimeSelection = args.minimumTimeSelection || defaults.minimumTimeSelection;
    this.callback = args.callback || defaults.callback;
    this.stack = [];
    this.registerMouseEvents();
  },

  registerMouseEvents: function() {
    var self = this;
    var ESCAPE_KEYCODE = 27;
    var rectangle;

    var drag = {
      startDt: null,
      stopDt: null,
      startPX: null,
      stopPX: null
    };

    this.svg.on("mousedown", onMousedown);
    this.svg.on("touchstart", onMousedown);
    this.svg.on("dblclick", onDblClick);

    function onDblClick(datum, index){
        if(self.stack.length){
            var range = self.stack.pop();
            self.callback(range[0], range[1]);
        }

    }

    function onMouseup(datum, index) {
      drag.stopDt = pointAsDate(d3.event);
      var beforeDrag = [
        self.graph.window.xMin,
        self.graph.window.xMax
      ];
      var windowAfterDrag = [
        drag.startDt,
        drag.stopDt
      ].sort(compareNumbers);

      reset(this);

      var range = windowAfterDrag[1] - windowAfterDrag[0],
          wholerange = beforeDrag[1] - beforeDrag[0];

      /* Can't zoom by less than 2% */
      if(range < self.minimumTimeSelection * wholerange){
        return;
      }
      self.graph.window.xMin = windowAfterDrag[0];
      self.graph.window.xMax = windowAfterDrag[1];

      var endTime = self.graph.window.xMax;

      if (isNaN(range)) {
        return;
      }
      self.stack.push(beforeDrag);
      self.callback(self.graph.window.xMin, self.graph.window.xMax);
    }

    function onMousemove() {
      var offset = drag.stopPX = (d3.event.offsetX || d3.event.layerX);
      if (offset > (self.svgWidth - 1) || offset < 1) {
        return;
      }

      var limits = [drag.startPX, offset].sort(compareNumbers);
      var selectionWidth = limits[1]-limits[0];
      if (isNaN(selectionWidth)) {
        return reset(this);
      }
      rectangle.attr("fill", self.fill)
               .attr("x", limits[0])
               .attr("width", selectionWidth);
    }

    function onMousedown() {
      var el = d3.select(this);
      rectangle = el.append("rect")
                    .style("opacity", self.opacity)
                    .attr("y", 0)
                    .attr("height", "100%");

      if(d3.event.preventDefault) {
        d3.event.preventDefault();
      } else {
        d3.event.returnValue = false;
      }
      drag.target = d3.event.target;
      drag.startDt = pointAsDate(d3.event);
      drag.startPX = d3.event.offsetX || d3.event.layerX;
      el.on("mousemove", onMousemove);
      d3.select(document).on("mouseup", onMouseup);
      d3.select(document).on("keyup", function() {
        if (d3.event.keyCode === ESCAPE_KEYCODE) {
          reset(this);
        }
      });
      el.on("touchmove", onMousemove);
      d3.select(document).on("touchend", onMouseup);
      d3.select(document).on("touchcancel", onMouseup);
    }

    function reset(el) {
      var s = d3.select(el);
      s.on("mousemove", null);
      d3.select(document).on("mouseup", null);
      s.on("touchmove", null);
      d3.select(document).on("touchend", null);
      d3.select(document).on("touchcancel", null);
      drag = {};
      rectangle.remove();
    }

    function compareNumbers(a, b) {
      return a - b;
    }

    function pointAsDate(e) {
      return Math.floor(self.graph.x.invert(e.offsetX || e.layerX));
    }
  }
});
return Rickshaw.Graph.DragZoom;
});

define('powa/views/GraphView',[
        'backbone',
        'd3',
        'rickshaw',
        'powa/views/WidgetView',
        'powa/models/Graph',
        'tpl!powa/templates/graph.html',
        'powa/utils/duration',
        'powa/utils/size',
        'powa/rickshaw/Rickshaw.Graph.DragZoom'
],
        function(Backbone, d3, Rickshaw, WidgetView, Graph, template, duration, size, DragZoom){
    var registry = {};
    var makeInstance = function(options){
        return new registry[options.model.get("renderer") || "line"](options);
    };

    var GraphView = WidgetView.extend({
            template: template,
            tag: "div",
            model: Graph,
            typname: "graph",
            axisFormats: {
                "number": Rickshaw.Fixtures.Number.formatKMBT,
                "size": new size.SizeFormatter().fromRaw,
                "sizerate": function(value){ return new size.SizeFormatter({suffix: "ps"}).fromRaw(value)},
                "duration": function(data){
                    return moment(parseFloat(data, 10)).preciseDiff(moment(0))
                },
                "percent": function(value){ return Math.round(value * 100) / 100 + '%'}
            },

            initialize: function(){
                var self = this;
                this.listenTo(this.model, "widget:needrefresh", this.update);
                this.listenTo(this.model, "widget:dataload-failed", this.fail);
                this.listenTo(this, "graph:resize", this.onResize);
                this.render();
                this.$nodata_el = $("<div>").html("No data").css({
                    position: "absolute",
                    left: "50%",
                    top: "50%",
                    width: "100%",
                    height: "100%"
                }).addClass("nodata");
                this.nodata_el = this.$nodata_el.get(0);
                this.$el.addClass("graph");
            },

            getGraph: function(series){
                var palette = new Rickshaw.Color.Palette({scheme: this.model.get("color_scheme"), interpolatedStopCount: 1});
                $.each(series, function(){
                    this.color = palette.color();
                });
                if(this.graph === undefined){
                    this.makeGraph(series);
                } else {
                    // update series
                    this.updateScales();
                    this.graph.series.splice(0, this.graph.series.length + 1);
                    this.graph.series.push.apply(this.graph.series, series);
                    this.adaptGraph(series);
                    this.graph.validateSeries(this.graph.series);
                }
                return this.graph;
            },

            getSize: function(){
                return {
                      width: this.$graph_elem.parent().innerWidth()
                };
            },

            updateScales: function(series){
                var self = this;
                $.each(this.y_axes, function(key, axis){
                    return;
                    var unit = key;
                    var ymin = +Infinity,
                        ymax = -Infinity;
                    axis.scale = d3.scale.linear();
                    var all_series = [];
                    _.each(this.graph.series, function(serie){
                        var metric = serie.metric;
                        if(metric.get("type") === key){
                            _.each(serie.data, function(datum){
                                ymin = Math.min(datum.y, ymin);
                                ymax = Math.max(datum.y, ymax);
                                serie.scale = axis.scale;
                                all_series.push(serie);
                            });
                        };
                    });
                    ymin = 0.8 * ymin;
                    ymax = 1.2 * ymax;
                    axis.scale = axis.scale.domain([ymin, ymax]).range([0, 1]);
                    _.each(all_series, function(serie){
                        serie.scale = axis.scale;
                    });
                });
            },

            adaptGraph: function(series){},

            makeGraph: function(series){
                // TODO: split this in subclasses for each type
                // of graph
                var renderer = this.model.get("renderer") || "line";
                this.$el.html(this.template(this.model.toJSON()));
                this.$graph_elem = this.$el.find(".graph_container");
                this.graph_elem = this.$graph_elem.get(0);
                this.y_axes = {};
                this.initGraph(series);
                this.initAxes(series);
                this.updateScales();
                this.initGoodies();
            },

            initAxes: function(series){
                var self = this;
                var i = 0;
                this.model.get("metrics").each(function(metric, index){
                    var type = metric.get("type") || "number";
                    if(this.y_axes[type] == undefined){
                        var formatter = self.axisFormats[type];
                        var orientation = i % 2 == 0 ? "left" : "right";
                        this.y_axes[type] = new Rickshaw.Graph.Axis.Y.Scaled({
                            element: this.$el.find(".graph_" + orientation + "_axis").get(0),
                            graph: this.graph,
                            min: 0,
                            scale: d3.scale.linear(),
                            orientation: orientation,
                            tickFormat: formatter
                        });
                        i++;
                    }
                }, this);
            },

            initGoodies: function(){
                this.legend = new Rickshaw.Graph.Legend( {
                    graph: this.graph,
                    element: this.$el.find('.graph_legend').get(0)
                });
            },


            nodata: function(){
                this.$nodata_el.width(this.$el.innerWidth());
                this.$nodata_el.height(this.$el.innerHeight());
                this.el.insertBefore(this.nodata_el, this.el.firstChild||null);
            },

            remove_nodata: function(){
                if(this.nodata_el && this.nodata_el.parentNode){
                    this.nodata_el.parentNode.removeChild(this.nodata_el);
                }
            },

            _resize: function(){
               if(this.graph){
                this.graph.configure({width: this.$graph_elem.parent().innerWidth()});
                _.each(this.y_axes, function(axis){
                    var width = axis.orientation === "left" ? 0 : this.$el.innerWidth();
                    axis.setSize({height: this.graph.height + 4, auto: true});
                }, this);
                this.graph.render();
                this.trigger("graph:resize");
               }
            },

            onResize: function(){},

            update: function(newseries){
                this.hideload();
                this.remove_nodata();
                if(newseries.length == 0){
                    this.nodata();
                }
                else{
                   this.getGraph(newseries);
                   this.graph.update();
                   if(this.legend){
                       this.legend.render();
                       var shelving = new Rickshaw.Graph.Behavior.Series.Toggle( {
                           graph: this.graph,
                           legend: this.legend
                       } );
                       var highlighter = new Rickshaw.Graph.Behavior.Series.Highlight( {
                           graph: this.graph,
                           legend: this.legend
                       });
                   }
                }
                this.trigger("widget:update");
            },

            show: function(){
                this._resize();
            },

            render: function(){
                return this;
            },
        }, {
            extend: function(instanceattrs, clsattrs){
                var newcls = WidgetView.extend.apply(this, [instanceattrs, clsattrs]);
                registry[newcls.prototype.rendername] = newcls;
                if(!newcls.makeInstance){
                    newcls.makeInstance = makeInstance;
                }
                return newcls;
            },
            makeInstance: makeInstance

        });
    return GraphView;

});

